import React, { Component } from 'react';
import { Map, GoogleApiWrapper, fitBounds } from 'google-maps-react';

const mapStyles = {
  width: '100%',
  height: '50%',
  position: 'absolute'
};

export class MapContainer extends Component {
  bounds = {
    nw: {lat: this.props.lattitude, long: this.props.longitude}
  }
  render() {
    return (
      <Map
        google={this.props.google}
        zoom={12}
        style={mapStyles}
        center={
         fitBounds(this.bounds)
        }
      />
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyD8UWoPDZssIjtLLe_ogggrymmRyrg_71E'
})(MapContainer);
